import React from "react";
import { Switch, Route } from "react-router-dom";
import "./App.css";
import { Navbar, Sidebar, Info } from "./components/Home";
class App extends React.Component {
  render() {
    return (
      <React.Fragment>
        <Navbar />
        <Sidebar />
        <Info />
        <Switch>
          <Route exact path="/" />
        </Switch>
      </React.Fragment>
    );
  }
}

export default App;
